import React from 'react';
import '../stylesheets/Work.css';

class Work  extends React.Component {
  render() {
    return (
      <div className="work">
        <ul className="project_container">
          <li className="project project1">
            <div><img src="../images/pokedex.jpg" alt="pokedex"></img></div>
          </li>
        </ul>
      </div>
    );
  }
}

export default Work;
